import React, { Fragment } from "react";

function ListServers()
{


	return (
		<Fragment>
			<table className="table mt-5 text-center">
				<thead>
					<tr>
						<th>Name</th>
						<th>IP</th>
						<th>Time Running</th>
						<th>Type</th>
						<th>Price Per Minute</th>

						<th>Edit</th>
						<th>delete</th>
					</tr>
				</thead>
				<tbody>
					
				</tbody>
			</table>
		</Fragment>
	);
}

export default ListServers;
